   "state" : "closed",
   "body" : "**What does your Instant Answer do?** The instant answer will return the current featured (front page) live broadcasters and their viewer count.\r\n\r\n**What problem does your Instant Answer solve (Why is it better than organic links)?** The problem solved for me saves a few clicks on my end. Instead of browsing to Twitch to see the current featured streams, I can just type twitch featured into my browser.\r\n\r\n**What is the data source for your Instant Answer?** (Provide a link if possible) https://github.com/justintv/twitch-api\r\n\r\n**Why did you choose this data source?** I wanted to contribute to DDG and also make my life easier.\r\n\r\n**Are there any other alternative (better) data sources?** No.\r\n\r\n**What are some example queries that trigger this Instant Answer?** You can query games or individual broadcasters: \r\n```twitch featured```\r\n```twitchtv featured```\r\n```featured twitch```\r\n```featured twitchtv```\r\n\r\n**Which communities will this Instant Answer be especially useful for? (gamers, book lovers, etc)** Gamers\r\n\r\n**Is this Instant Answer connected to a DuckDuckHack Instant Answer idea?** I already submitted one for exact queries, this is just expanding to more data points.\r\n\r\n**Which existing Instant Answers will this one supersede/overlap with?** None unless we had twitch tv featured or twitch.tv featured.  That will make TvMaze angry.\r\n\r\n**Are you having any problems? Do you need our help with anything?** None, just need criticism from the great community here =)\r\n\r\n**What are the terms of use for the API? Will DuckDuckGo need specific authorization (e.g. an API key)? Are there any costs associated with API usage?** Free to use, requires an api key, no cost for usage.\r\n\r\n**Where did you hear about DuckDuckHack? (For first time contributors)** Been using DDG for awhile because they don't track their users activity.  Security is important to me and I believe using DDG is a good start in improving my online experience.\r\n\r\n**What does the Instant Answer look like? (Provide a screenshot for new or updated Instant Answers)** \r\n![twf](https://cloud.githubusercontent.com/assets/2160810/6999976/1886fd4a-dbde-11e4-906a-723aae6e20ed.png)\r\n\r\n**Checklist**\r\n\r\nPlease place an 'X' where appropriate.\r\n\r\n[x] Added metadata and attribution information\r\n[x] Wrote test file and added to t/ directory\r\n[x] Verified that instant answer adheres to design guidelines (https://duck.co/duckduckhack/design_styleguide)\r\n[x] Verified that instant answer adheres to code styleguide (https://duck.co/duckduckhack/code_styleguide)\r\n[x] Tested cross-browser compatibility\r\n\r\n    Please let us know which browsers/devices you've tested on:\r\n    - Windows 8\r\n        [] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] IE 10\r\n\r\n    - Windows 7\r\n        [x] Google Chrome\r\n        [x] Firefox\r\n        [] Opera\r\n        [] IE 8\r\n        [X] IE 9\r\n        [X] IE 10\r\n\r\n    - Windows XP\r\n        [] IE 8\r\n\r\n    - Mac OSX\r\n        [x] Google Chrome\r\n        [x] Firefox\r\n        [] Opera\r\n        [x] Safari\r\n\r\n    - iOS (iPhone)\r\n        [] Safari Mobile\r\n        [] Google Chrome\r\n        [] Opera\r\n\r\n    - iOS (iPad)\r\n        [] Safari Mobile\r\n        [] Google Chrome\r\n        [] Opera\r\n\r\n    - Android\r\n        [] Firefox\r\n        [] Native Browser\r\n        [] Google Chrome\r\n        [] Opera\r\n\r\n------\r\n\r\nIA Page: https://duck.co/ia/view/twitch_featured",
