   "state" : "closed",
   "body" : "We've been modifying the API results to deal with the constantly changing URL for the images (see https://github.com/duckduckgo/zeroclickinfo-spice/blob/master/share/spice/in_theaters/in_theaters.js#L6...L16), and it's been a mess especially since the images in the API will be deprecated. \r\n\r\nA good way is to use another API for the images such as http://docs.themoviedb.apiary.io/#introduction/useful-links. It's worth investigating a way of accessing their images through Movie and InTheaters because we're starting to see broken images again.\r\n\r\n@moollaza mentioned that we could:\r\n- Use the IMDB ID in the RT results and match it with [MovieDB](https://www.themoviedb.org/)\r\n- ~~Maybe some JS magic to access the MovieDB images without calling the API~~\r\n  - Not possible, image URLs are all unique \r\n\r\n![screen shot 2015-03-17 at 11 39 44 am](https://cloud.githubusercontent.com/assets/81969/6691019/59ee1ec4-cc9a-11e4-9153-34fbdef92b19.png)\r\n\r\nhttps://duck.co/ia/view/movie\r\nhttps://duck.co/ia/view/in_theaters",
