   "comments" : 11,
   "state" : "open",
   "body" : "We recently added support for http://momentjs.com/, and it would be cool if we move things like https://github.com/duckduckgo/zeroclickinfo-spice/blob/master/share/spice/hacker_news/hacker_news.js#L63.\r\n\r\n![screen shot 2015-02-19 at 1 31 09 pm](https://cloud.githubusercontent.com/assets/81969/6273242/b514424c-b83b-11e4-8485-d0f4baa9c2c1.png)\r\n\r\nIf possible, of course. This might be a huge task that needs a bunch of testing so it's best to do one PR for each IA so that it's easier to review.\r\n\r\nUsage of moment.js in DuckDuckGo is as follows:\r\n\r\n```javascript\r\nDDG.require(\"moment.js\", function() {\r\n    console.log(moment(\"9/23/2015\").format(\"dddd, MMMM Do YYYY\")); // Wednesday, September 23rd 2015\r\n});\r\n```",
