   "state" : "closed",
   "body" : "Thanks for your consideration.\r\n\r\n**What does your Instant Answer do?**\r\nDisplay information about a Nxt (cryptocurrency) account (See http://nxt.org for info about Nxt)\r\nIt displays the balance of the account, the amount of coins \"forged\" (mined), and the amount assets in one's possession.\r\n\r\n**What problem does your Instant Answer solve (Why is it better than organic links)?**\r\nMakes it easier to lookup e.g. one's account balance, without having to go a block explorer or start the client.\r\nAlso makes it easy to get some quick info about someone else's account.\r\n\r\n**What is the data source for your Instant Answer? (Provide a link if possible)**\r\nThe API of mynxt.info: https://wallet.mynxt.info/docs/\r\nIt also uses http://goqr.me/api/ to create a QR code\r\n\r\n**Why did you choose this data source?**\r\nIt's a Nxt API run by a reliable website/company. In principle, any accessible Nxt node could be used.\r\n\r\n**Are there any other alternative (better) data sources?**\r\nNot that I'm aware of. Of course, DDG could run an own Nxt node, to not rely on a 3rd party service.\r\n\r\n**What are some example queries that trigger this Instant Answer?**\r\nAny NXT account in Reed-Solomon format, e.g.:\r\nNXT-AR77-SW4Y-M3VA-DUSTY\r\nNXT-W6CT-NPDH-AAQW-HWCHA\r\n\r\n**Which communities will this Instant Answer be especially useful for? (gamers, book lovers, etc)**\r\nFor anyone active in the Nxt ecosystem: crypto/blockchain enthusiasts, programmers, investors, marketplace buyers/seller etc.\r\nIt's a young, growing community.\r\n\r\n**Is this Instant Answer connected to a DuckDuckHack [Instant Answer idea](https://duck.co/ideas)?**\r\nNo.\r\n\r\n**Which existing Instant Answers will this one supersede/overlap with?**\r\nNone.\r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\nNo, making this was pretty straight forward. Thanks for the great docs.\r\n\r\n**What are the terms of use for the API? Will DuckDuckGo need specific authorization (e.g. an API key)? Are there any costs associated with API usage?**\r\nAn account at mynxt.info is required. API usage is free.\r\ngoqr.me API also is free, with no account required.\r\n\r\n**Where did you hear about DuckDuckHack? (For first time contributors)**\r\nDon't remember. :)\r\n\r\n**What does the Instant Answer look like? (Provide a screenshot for new or updated Instant Answers)**\r\nhttp://i.imgur.com/IgLb43r.png\r\n\r\n## Checklist\r\nPlease place an 'X' where appropriate.\r\n\r\n```\r\n[x] Added metadata and attribution information\r\n[x] Wrote test file and added to t/ directory\r\n[x] Verified that instant answer adheres to design guidelines (https://duck.co/duckduckhack/design_styleguide)\r\n[x] Verified that instant answer adheres to code styleguide (https://duck.co/duckduckhack/code_styleguide)\r\n[x] Tested cross-browser compatibility\r\n\r\n    Please let us know which browsers/devices you've tested on:\r\n    - Windows 8\r\n        [] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] IE 10\r\n\r\n    - Windows 7\r\n        [x] Google Chrome\r\n        [x] Firefox\r\n        [] Opera\r\n        [] IE 8\r\n        [] IE 9\r\n        [x] IE 10\r\n\r\n    - Windows XP\r\n        [] IE 7\r\n        [] IE 8\r\n\r\n    - Mac OSX\r\n        [] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] Safari\r\n\r\n    - iOS (iPhone)\r\n        [] Safari Mobile\r\n        [] Google Chrome\r\n        [] Opera\r\n\r\n    - iOS (iPad)\r\n        [] Safari Mobile\r\n        [] Google Chrome\r\n        [] Opera\r\n\r\n    - Android\r\n        [x] Firefox\r\n        [x] Native Browser\r\n        [x] Google Chrome\r\n        [] Opera\r\n\r\n    - Ubuntu Linux\r\n        [x] Chrome\r\n        [x] Firefox\r\n```\r\n\r\nhttps://duck.co/ia/view/nxt_account",
