   "state" : "closed",
   "body" : "**What does your Instant Answer do?**\r\nDisplays the UV Index for user's location (in the US), as provided by the Environmental Protection Agency.\r\nDisplay is in the form of an image provided by the World Health Organization that also indicates if protection against sun exposure is required.\r\n\r\n**What problem does your Instant Answer solve (Why is it better than organic links)?**\r\nIt provides a quick way to check the UV Index for the user's location, which is useful for deciding on clothing and sun protection when going outside.\r\n\r\n**What is the data source for your Instant Answer? (Provide a link if possible)**\r\nWeb service provided by the EPA:\r\nhttp://www.epa.gov/enviro/facts/services.html#uvindex\r\n\r\n**Why did you choose this data source?**\r\nEase of use, clarity, most interesting target region\r\n\r\n**Are there any other alternative (better) data sources?**\r\nMany weather agencies of other countries seem to provide web services, but they focus on the given country. Still looking for a source for global data.\r\n\r\n**What are some example queries that trigger this Instant Answer?**\r\nuv\r\nuv index\r\n\r\n**Which communities will this Instant Answer be especially useful for? (gamers, book lovers, etc)**\r\nI like to check it before I send my kid to kindergarden to decide if he needs sun protection.\r\n\r\n**Is this Instant Answer connected to a DuckDuckHack [Instant Answer idea](https://duck.co/ideas)?**\r\nyes https://duck.co/ideas/idea/1148/uv-index-search\r\n\r\n**Which existing Instant Answers will this one supersede/overlap with?**\r\nnone I am aware of\r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\nMaybe for the next version. Ultimately it should be possible to enter location search terms. But since the EPA web service only accepts location names in a very specific form, I skipped on the problem of converting search terms into the correct form for now. Therefore at the moment it only works with locations provided by the location_api, which provide the correct form.\r\n\r\n**What are the terms of use for the API? Will DuckDuckGo need specific authorization (e.g. an API key)? Are there any costs associated with API usage?**\r\nI'm not aware of any restrictions. No authorization is needed, no costs apply.\r\n\r\n**Where did you hear about DuckDuckHack? (For first time contributors)**\r\nDuckDuckGo job application page\r\n\r\n**What does the Instant Answer look like? (Provide a screenshot for new or updated Instant Answers)**\r\n![duckduckuv](https://cloud.githubusercontent.com/assets/7099/5673056/9acf35b4-9797-11e4-852d-9290f351d3f3.png)\r\n\r\n## Checklist\r\nPlease place an 'X' where appropriate.\r\n\r\n```\r\n[X] Added metadata and attribution information\r\n[X] Wrote test file and added to t/ directory\r\n[X] Verified that instant answer adheres to design guidelines (https://duck.co/duckduckhack/design_styleguide)\r\n[X] Verified that instant answer adheres to code styleguide (https://duck.co/duckduckhack/code_styleguide)\r\n[] Tested cross-browser compatibility\r\n\r\n    Please let us know which browsers/devices you've tested on:\r\n    - Windows 8\r\n        [] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] IE 10\r\n\r\n    - Windows 7\r\n        [] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] IE 8\r\n        [] IE 9\r\n        [] IE 10\r\n\r\n    - Windows XP\r\n        [] IE 7\r\n        [] IE 8\r\n\r\n    - Mac OSX\r\n        [] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] Safari\r\n\r\n    - iOS (iPhone)\r\n        [] Safari Mobile\r\n        [] Google Chrome\r\n        [] Opera\r\n\r\n    - iOS (iPad)\r\n        [] Safari Mobile\r\n        [] Google Chrome\r\n        [] Opera\r\n\r\n    - Android\r\n        [] Firefox\r\n        [] Native Browser\r\n        [] Google Chrome\r\n        [] Opera\r\n```\r\n",
