   "body" : "\"time austin\" and \"time san francisco\" now work!\r\n\r\n![screen shot 2014-12-02 at 3 31 26 pm](https://cloud.githubusercontent.com/assets/81969/5270347/548712a6-7a38-11e4-9afc-40f51c477f24.png)\r\n\r\nProblem was that it was comparing:\r\n```javascript\r\nDDG.stringsRelevant(\"san francisco, california\", \"San Francisco United States\")\r\n```\r\n\r\nSo instead it compares:\r\n```javascript\r\nDDG.stringsRelevant(\"san francisco, california\", \"San Francisco\")\r\n```\r\n\r\nWhich works. Unfortunately, this is a deep trigger so it can't be tested on DuckPAN. CC @jdorweiler @MariagraziaAlastra @moollaza ",
