   "state" : "closed",
   "body" : "**What does your Instant Answer do?**\r\nReturns the most recent population data for a specified country\r\n\r\n**What problem does your Instant Answer solve (Why is it better than organic links)?**\r\nUsers asking for populations in queries can get their answer faster / easier.\r\n\r\n**What is the data source for your Instant Answer? (Provide a link if possible)**\r\nWorld Bank. http://data.worldbank.org/node/9\r\n\r\n**Why did you choose this data source?**\r\nUsed in other spices such as Rainfall. Provides population data for previous years so the spice can be expanded later on.\r\n\r\n**Are there any other alternative (better) data sources?**\r\nI believe that World Bank is the most comprehensive source.\r\n\r\n**What are some example queries that trigger this Instant Answer?**\r\n'population of usa'\r\n'population canada'\r\n'population of rus'\r\n\r\n**Which communities will this Instant Answer be especially useful for? (gamers, book lovers, etc)**\r\nPeople interested in populations of other countries.\r\n\r\n**Is this Instant Answer connected to a DuckDuckHack [Instant Answer idea](https://duck.co/ideas)?**\r\nhttps://duck.co/ideas/idea/4643/country-facts-especially-population\r\n\r\n**Which existing Instant Answers will this one supersede/overlap with?**\r\nZanran has a trigger word for population, but from my testing it does not trigger.\r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\nA review of what can be improved would be awesome. I was not sure on the best subtitle for the spice.\r\n\r\n**What are the terms of use for the API? Will DuckDuckGo need specific authorization (e.g. an API key)? Are there any costs associated with API usage?**\r\n\r\nThe full terms are located here: http://data.worldbank.org/summary-terms-of-use\r\nThe one that seems applicable is: \"You must include attribution for the data you use in the manner indicated in the metadata included with the data.\" And we provide a link to World Bank,\r\n\r\nThere are no API Keys or costs associated.\r\n\r\n\r\n**What does the Instant Answer look like? (Provide a screenshot for new or updated Instant Answers)**\r\n![ddg-populationspice](https://cloud.githubusercontent.com/assets/3364763/5137873/2179115a-7111-11e4-82da-5629f83bfa93.png)\r\n\r\n\r\n## Checklist\r\nPlease place an 'X' where appropriate.\r\n\r\n```\r\n[X] Added metadata and attribution information\r\n[X] Wrote test file and added to t/ directory\r\n[X] Verified that instant answer adheres to design guidelines (https://duck.co/duckduckhack/design_styleguide)\r\n[X] Verified that instant answer adheres to code styleguide (https://duck.co/duckduckhack/code_styleguide)\r\n[] Tested cross-browser compatibility\r\n\r\n    Please let us know which browsers/devices you've tested on:\r\n    - Windows 8\r\n        [X] Google Chrome\r\n        [X] Firefox\r\n        [] Opera\r\n        [] IE 10\r\n\r\n    - Windows 7\r\n        [] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] IE 8\r\n        [] IE 9\r\n        [] IE 10\r\n\r\n    - Windows XP\r\n        [] IE 7\r\n        [X] IE 8 * \r\n\r\n    - Mac OSX\r\n        [] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] Safari\r\n\r\n    - iOS (iPhone)\r\n        [] Safari Mobile\r\n        [] Google Chrome\r\n        [] Opera\r\n\r\n    - iOS (iPad)\r\n        [] Safari Mobile\r\n        [] Google Chrome\r\n        [] Opera\r\n\r\n    - Android\r\n        [] Firefox\r\n        [] Native Browser\r\n        [] Google Chrome\r\n        [] Opera\r\n```\r\n\r\n* I ran it through IE8 for XP and there is a slight issue with the search bar vertical spacing, but this is not limited to the population spice.\r\nScreenshot attached\r\n\r\n![iexp](https://cloud.githubusercontent.com/assets/3364763/5138185/a74e02c0-7118-11e4-8f55-894efd92fa33.png)\r\n",
