   "body" : "This is still a WIP opening PR as requested by @mwmiller \r\n\r\nExample queries: `what is the time in Amsterdam`, `time Amsterdam`\r\n\r\n### :large_blue_circle: Notes:\r\n\r\n1. See an example of the [response received](https://gist.github.com/chrisjwilsoncom/00e065f7f3c10f81b51b) from the timeanddate API.\r\n\r\n2. ~~Need to add some more test cases and~~ add some regexp guards to the time.pm.\r\n\r\n### :red_circle: Known Issues:\r\n\r\n1. The design is very minimal and I think I'm using the wrong **line-height** for the sub-text :grin:, it would be great to make it stand out a little more. See the [fullscreen example](https://cloud.githubusercontent.com/assets/5282264/4767490/40188f82-5b5e-11e4-8b14-41bebc89babe.png) on timeanddate.com \r\n\r\n2. The meta sourceUrl needs to be linked to the timeanddate.com page.\r\n\r\n**Dark**\r\n![timelookdark](https://cloud.githubusercontent.com/assets/5282264/4767371/0f1adb3e-5b5d-11e4-9682-c324a9c32387.png)\r\n\r\n**Default**\r\n![timelook](https://cloud.githubusercontent.com/assets/5282264/4767372/0f202ff8-5b5d-11e4-879a-4d61514de661.png)\r\n\r\n**Default - Mobile iPhone 5 - 320x568**\r\n![mobile](https://cloud.githubusercontent.com/assets/5282264/4772500/072b90f8-5b99-11e4-9384-daabadd4badc.png)\r\n\r\n@jagtalon @moollaza  ",
