   "state" : "closed",
   "body" : "Partially / fully addresses the issue posted in https://github.com/duckduckgo/zeroclickinfo-spice/issues/1176:\r\n\r\n- Only show two digits after the decimal point, e.g., \"1.123\" will be displayed as \"1.12\"\r\n- The mobile display now changes based on the amount of content. That is, we change the look when the numbers get bigger.\r\n\r\n**Small Numbers:**\r\n![screen shot 2014-10-23 at 6 24 27 pm](https://cloud.githubusercontent.com/assets/81969/4762660/1bc2622e-5b05-11e4-9f97-a43365d309d2.png)\r\n\r\n**Large Numbers:**\r\n![screen shot 2014-10-23 at 6 25 02 pm](https://cloud.githubusercontent.com/assets/81969/4762661/1bc44242-5b05-11e4-97d9-8beaa2fa53cb.png)\r\n\r\n- Desktop view now has a \"View Chart\" right beside the \"More at ...\" link.\r\n\r\n![screen shot 2014-10-23 at 6 38 41 pm](https://cloud.githubusercontent.com/assets/81969/4762677/5ff30232-5b05-11e4-818f-a945d33cd890.png)\r\n\r\n- And, of course, it works on IE 8.\r\n\r\n![screen shot 2014-10-23 at 6 41 05 pm](https://cloud.githubusercontent.com/assets/81969/4762690/b364f93e-5b05-11e4-8afb-756a20c7849d.png)\r\n\r\n- Code is a little messy so some cleanup is in order.\r\n\r\n- It's currently up on https://ddh5.duckduckgo.com/?q=10+jpy+to+sgd\r\n\r\nCC @bsstoner @MariagraziaAlastra @moollaza @chrismorast \r\n",
