   "comments" : 9,
   "state" : "closed",
   "body" : "![screen shot 2014-09-18 at 2 57 14 pm](https://cloud.githubusercontent.com/assets/81969/4325487/ae66c6e4-3f65-11e4-9759-fc7119b77293.png)\r\n\r\nThis happens because when the [`Date`](https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Date) constructor gets a string, it passes it to [`Date.parse()`](https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Date/parse), and that doesn't exist in IE 8.\r\n\r\nWe could use `DDG.getDateFromString`, but the date returned by the API is in UTC. So `DDG.getDateFromString(\"2014-09-18T10:00:47Z\")` would give us 10:00am local time instead of 6:00am since `getDateFromString` treats the input as localtime.\r\n",
