   "state" : "closed",
   "body" : "# Spice Pull Request Template\r\n\r\nUsing this template will help us better understand your Instant Answer and assist you when necessary.  Simply copy and paste the markdown below into the description of your GitHub pull request and complete as appropriate.\r\n\r\n**What does your instant answer do?**\r\nDisplays pricing, up-to-date availability, datasheets (when available) for searches on parts\r\n\r\n**What problem does your instant answer solve (Why is it better than organic links)?**\r\nA specific search on a part, might provide more buying options and more accurate results\r\n\r\n**What is the data source for your instant answer? (Provide a link if possible)**\r\nhttp://developers.arrow.com\r\nthe source of data comes from Arrow Electronics, Inc.\r\n\r\n**Why did you choose this data source?**\r\nData source was originally built for third-parties and customers, but could be easily extended to support search engines. It is quite fast and averages search results < 50ms\r\n\r\n**Are there any other alternative (better) data sources?**\r\nOctopart seems to have an alternative. Not sure if other companies in the industry provide API access.\r\n\r\n**What are some example queries that trigger this instant answer?**\r\npart bav99\r\narrow lm324n\r\n\r\n**Which communities will this instant answer be especially useful for? (gamers, book lovers, etc)**\r\nSpecific to the Electronic industry: students, designers, buyers, brokers\r\n\r\n**Is this instant answer connected to a DuckDuckHack [instant answer idea](https://duck.co/ideas)?**\r\nhttps://duck.co/ideas/idea/223/catalogue-number-part-number-sku-lookup\r\nsatisfies the electronic portion of this idea\r\n\r\n**Which existing instant answers will this one supersede/overlap with?**\r\noverlaps with Octopart\r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\n\r\n**\\*\\*Note:** Please attach a screenshot for new instant answer pull requests, and for pull requests which modify the look/design of existing instant answers.\r\n\r\n## Checklist\r\nPlease place an 'X' where appropriate.\r\n\r\n```\r\n[x] Added metadata and attribution information\r\n[x] Wrote test file and added to t/ directory\r\n[x] Verified that instant answer adheres to design guidelines (https://duck.co/duckduckhack/design_styleguide)\r\n[x] Verified that instant answer adheres to code styleguide (https://duck.co/duckduckhack/code_styleguide)\r\n[x] Tested cross-browser compatibility\r\n\r\n    Please let us know which browsers/devices you've tested on:\r\n    - Windows 8\r\n        [] Google Chrome   \r\n        [] Firefox         \r\n        [] Opera           \r\n        [x] IE 10           \r\n\r\n    - Windows 7\r\n        [] Google Chrome   \r\n        [] Firefox         \r\n        [] Opera           \r\n        [] IE 8            \r\n        [] IE 9            \r\n        [] IE 10           \r\n\r\n    - Windows XP\r\n        [] IE 7            \r\n        [] IE 8            \r\n\r\n    - Mac OSX\r\n        [x] Google Chrome   \r\n        [x] Firefox         \r\n        [] Opera           \r\n        [x] Safari          \r\n\r\n    - iOS (iPhone)\r\n        [] Safari Mobile   \r\n        [] Google Chrome   \r\n        [] Opera           \r\n\r\n    - iOS (iPad)\r\n        [] Safari Mobile   \r\n        [] Google Chrome   \r\n        [] Opera            \r\n\r\n    - Android\r\n        [] Firefox         \r\n        [] Native Browser  \r\n        [] Google Chrome   \r\n        [] Opera\r\n```\r\n![ddg_arrow](https://cloud.githubusercontent.com/assets/1333829/4296684/3ef38128-3dfb-11e4-9bc4-f1f46ce85935.png)\r\n",
