   "body" : "Uh, this is my first instant answer! :smile:\r\n\r\n**What does your instant answer do?**\r\nIt returns all upcoming concerts for a given artist/band.\r\n\r\n**What problem does your instant answer solve (Why is it better than organic links)?**\r\nIt answers to the user's question a lot quicker than organic links.\r\n\r\n**What is the data source for your instant answer? (Provide a link if possible)**\r\n[SeatGeek](https://seatgeek.com/)\r\n\r\n**Why did you choose this data source?**\r\nIt was suggested on the forum, and @jagtalon said that there used to be an IA using SeatGeek once.\r\n\r\n**Are there any other alternative (better) data sources?**\r\nNo, I think this one provides all the necessary informations.\r\n\r\n**What are some example queries that trigger this instant answer?**\r\n\"upcoming concerts weezer\", \"in flames live shows\", \"bastille concert\", \"queens of the stone age live\"\r\n\r\n**Which communities will this instant answer be especially useful for? (gamers, book lovers, etc)**\r\nPeople passionate about music, which would love to see their favourite artists/bands live.\r\n\r\n**Is this instant answer connected to a DuckDuckHack [instant answer idea](https://duck.co/ideas)?**\r\n[Yes, of course!](https://duck.co/ideas/idea/179/improvement-show-upcoming-concert-for-a-musician)\r\n\r\n**Which existing instant answers will this one supersede/overlap with?**\r\nNo one.\r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\nJust give me your feedback, please :) thank you!\r\n\r\n**\\*\\*Note:** Please attach a screenshot for new instant answer pull requests, and for pull requests which modify the look/design of existing instant answers.\r\n![screen shot 2014-08-01 at 17 00 46](https://cloud.githubusercontent.com/assets/3652195/4102274/3e012526-3122-11e4-94d4-b22a275da6b7.png)\r\n![screen shot 2014-08-01 at 17 01 04](https://cloud.githubusercontent.com/assets/3652195/4102275/4349e432-3122-11e4-9bbf-71649f1b2c76.png)\r\n\r\nAnd one screenshot with acronyms:\r\n![screen shot 2014-08-01 at 17 20 44](https://cloud.githubusercontent.com/assets/3652195/4102282/a9f3187a-3122-11e4-8d9c-86b5d2bb03fd.png)\r\n\r\n\r\n## Checklist\r\nPlease place an 'X' where appropriate.\r\n\r\n```\r\n[x] Added metadata and attribution information\r\n[x] Wrote test file and added to t/ directory\r\n[x] Verified that instant answer adheres to design guidelines (https://duck.co/duckduckhack/design_styleguide)\r\n[x] Verified that instant answer adheres to code styleguide (https://duck.co/duckduckhack/code_styleguide)\r\n[x] Tested cross-browser compatibility\r\n\r\n    Please let us know which browsers/devices you've tested on:\r\n    - Windows 8\r\n        [] Google Chrome   \r\n        [] Firefox         \r\n        [] Opera           \r\n        [] IE 10           \r\n\r\n    - Windows 7\r\n        [x] Google Chrome   \r\n        [x] Firefox         \r\n        [x] Opera           \r\n        [x] IE 8            \r\n        [] IE 9            \r\n        [] IE 10           \r\n\r\n    - Windows XP\r\n        [] IE 7            \r\n        [] IE 8            \r\n\r\n    - Mac OSX\r\n        [] Google Chrome   \r\n        [] Firefox         \r\n        [] Opera           \r\n        [] Safari          \r\n\r\n    - iOS (iPhone)\r\n        [] Safari Mobile   \r\n        [] Google Chrome   \r\n        [] Opera           \r\n\r\n    - iOS (iPad)\r\n        [] Safari Mobile   \r\n        [] Google Chrome   \r\n        [] Opera            \r\n\r\n    - Android\r\n        [] Firefox         \r\n        [] Native Browser  \r\n        [] Google Chrome   \r\n        [] Opera\r\n```",
