   "body" : "@jagtalon after the last pull request got in the way of the latest update in the Duck Duck Go API (see here: https://github.com/duckduckgo/zeroclickinfo-spice/pull/495), this is the new pull request according to the new API. All better and bigger :)\r\n\r\nHere a screenshot highlighting how spoonacular understands what \"popular\" means and therefore highlights the likes and ranks accordingly.\r\n![duckduckgo-spoonacular-popular](https://cloud.githubusercontent.com/assets/1111388/3791032/2c0ec174-1b25-11e4-9c91-95b66e0156a6.png)\r\n\r\nAnother example, this time the user doesn't want to spend a lot of time, so we rank by the time it takes to make the recipe.\r\n![duckduckgo-spoonacular-fast](https://cloud.githubusercontent.com/assets/1111388/3791034/2fcc5f88-1b25-11e4-96f5-59129bef2ee2.png)\r\n\r\nWould love to see this on Duck Duck Go ;)",
