   "body" : "**What does your instant answer do?**\r\n- Provides multiple currency exchange rates using XE.com data\r\n\r\n**What problem does your instant answer solve (Why is it better than organic links)?**\r\n- Usually if a person is searching a currency, they are interested in seeing the relative currency worth.\r\n\r\n**What is the data source for your instant answer? (Provide a link if possible)**\r\n- http://www.xe.com\r\n\r\n**Why did you choose this data source?**\r\n- Best currency exchange rates on Internet.  :)\r\n\r\n**Are there any other alternative (better) data sources?**\r\n\r\n**What are some example queries that trigger this instant answer?**\r\n- usd\r\n- 10 usd cad\r\n\r\n**Which communities will this instant answer be especially useful for? (gamers, book lovers, etc)**\r\n- travel, finance\r\n\r\n**Is this instant answer connected to a DuckDuckHack [instant answer idea](https://duck.co/ideas)?**\r\n- no\r\n\r\n**Which existing instant answers will this one supersede/overlap with?**\r\n- wolfram alpha\r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\n- no\r\n\r\n**\\*\\*Note:** Please attach a screenshot for new instant answer pull requests, and for pull requests which modify the look/design of existing instant answers.\r\n\r\n## Checklist\r\nPlease place an 'X' where appropriate.\r\n\r\n```\r\n[X] Added metadata and attribution information\r\n[X] Wrote test file and added to t/ directory\r\n[X] Verified that instant answer adheres to design guidelines(https://github.com/duckduckgo/duckduckgo-documentation/blob/master/duckduckhack/styleguides/design_styleguide.md)\r\n[X] Tested cross-browser compatibility\r\n\r\n    Please let us know which browsers/devices you've tested on:\r\n    - Windows 8\r\n        [X] Google Chrome   \r\n        [X] Firefox         \r\n        [X] Opera           \r\n        [X] IE 10           \r\n\r\n    - Windows 7\r\n        [X] Google Chrome   \r\n        [X] Firefox         \r\n        [X] Opera           \r\n        [X] IE 8            \r\n        [X] IE 9            \r\n        [X] IE 10           \r\n\r\n    - Windows XP\r\n        [] IE 7            \r\n        [X] IE 8            \r\n\r\n    - Mac OSX\r\n        [X] Google Chrome   \r\n        [X] Firefox         \r\n        [X] Opera           \r\n        [X] Safari          \r\n\r\n    - iOS (iPhone)\r\n        [X] Safari Mobile   \r\n        [X] Google Chrome   \r\n        [] Opera           \r\n\r\n    - iOS (iPad)\r\n        [X] Safari Mobile   \r\n        [X] Google Chrome   \r\n        [] Opera            \r\n\r\n    - Android\r\n        [X] Firefox         \r\n        [X] Native Browser  \r\n        [X] Google Chrome   \r\n        [] Opera\r\n```\r\n\r\n![2300_usd_in_cad_at_duckduckgo](https://cloud.githubusercontent.com/assets/116121/4276439/3661ba26-3d05-11e4-86e8-143e8794a390.png)\r\n\r\n![image](https://cloud.githubusercontent.com/assets/116121/4276417/0a10a144-3d05-11e4-8d01-0ca35709d135.png)\r\n",
