   "closed_at" : "2015-01-13T17:09:44Z",
   "number" : 935,
   "comments_url" : "https://api.github.com/repos/duckduckgo/zeroclickinfo-spice/issues/935/comments",
   "labels_url" : "https://api.github.com/repos/duckduckgo/zeroclickinfo-spice/issues/935/labels{/name}",
   "comments" : 56,
   "pull_request" : {
      "patch_url" : "https://github.com/duckduckgo/zeroclickinfo-spice/pull/935.patch",
      "html_url" : "https://github.com/duckduckgo/zeroclickinfo-spice/pull/935",
      "url" : "https://api.github.com/repos/duckduckgo/zeroclickinfo-spice/pulls/935",
      "diff_url" : "https://github.com/duckduckgo/zeroclickinfo-spice/pull/935.diff"
   },
   "state" : "closed",
   "body" : "**What does your instant answer do?**\r\nDisplays relevant free online college courses\r\n\r\n**What problem does your instant answer solve (Why is it better than organic links)?**\r\nThere are over 1200 free college courses available but they are created by over 200 universities and spread over a dozen platforms. A user can go to each providerâ€™s site or go to a site that aggregates courses. Both of these methods are time consuming. The aggregation sites cut down on the time a little bit but the user is still faced with lots of courses to look at with little direction and has to figure out which courses are directly comparable and which order to take courses. \r\nCourseBuffet is better. We look at each course individually and then classify it under a subject, generic title and level/year that is roughly equivalent to what the course would be at a US university. This enables users to know which courses are directly comparable even if their title is different. No more time consuming searching and guessing! This also allows them to get a good idea of what order to take courses even if they are taking courses from multiple providers/platforms.\r\n\r\n**What is the data source for your instant answer? (Provide a link if possible)**\r\nCourseBuffet(http://www.coursebuffet.com) - We(CourseBuffet) receive the data from providers(MOOCs) then we use our own classification system to create our own database. This means a human looks at every course and analyses it. This gives users the most relevant results.\r\n\r\n**Why did you choose this data source?**\r\nOur database produces better results and saves usersâ€™ time and lessens their confusion.\r\n\r\n**Are there any other alternative (better) data sources?**\r\nNo - There are other sites that aggregate courses from different MOOCs, but does not properly classify it.\r\n\r\n**What are some example queries that trigger this instant answer?**\r\n\"computer science course\", \"Human Physiology\", \"udacity computer science\"\r\n\r\n**Which communities will this instant answer be especially useful for? (gamers, book lovers, etc)**\r\nPeople trying college education for the first time and people who are lifelong learners\r\n\r\n**Is this instant answer connected to a DuckDuckHack [instant answer idea](https://duck.co/ideas)?**\r\nNot that we could find. We were approached by DDG to create this instant answer\r\n\r\n**Which existing instant answers will this one supersede/overlap with?**\r\nNone that we could find\r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\nIn development environment, it seems like the `text` template is not behaving properly on Firefox and IE, the link to the individual tile does not go anywhere, It works on Chrome/Safari/Opera. I tried running the `github_search` answer on my dev server and it had the same issue, any help on this will be great!\r\n\r\n**\\*\\*Note:** Please attach a screenshot for new instant answer pull requests, and for pull requests which modify the look/design of existing instant answers.\r\n![screen shot 2014-07-05 at 1 21 10 pm](https://cloud.githubusercontent.com/assets/123185/3487492/127ddd4e-0482-11e4-8a8b-b787123613e3.png)\r\n\r\n\r\n## Checklist\r\nPlease place an 'X' where appropriate.\r\n\r\n```\r\n[X] Added metadata and attribution information\r\n[X] Wrote test file and added to t/ directory\r\n[] Verified that instant answer adheres to design guidelines(https://github.com/duckduckgo/duckduckgo-documentation/blob/master/duckduckhack/styleguides/design_styleguide.md)\r\n[X] Tested cross-browser compatibility\r\nNotes: \r\n1. The Design Guidelines seem out of date, but I haven't added any special style elements of my own, it looks consistent with the DDG design.\r\n2. Having issue while testing on the development environment as mentioned before, so not marking Firefox/IE as tested.\r\n\r\n    Please let us know which browsers/devices you've tested on:\r\n    - Windows 8\r\n        [X] Google Chrome   \r\n        [] Firefox         \r\n        [X] Opera           \r\n        [] IE 10           \r\n\r\n    - Windows 7\r\n        [X] Google Chrome   \r\n        [] Firefox         \r\n        [X] Opera           \r\n        [] IE 8            \r\n        [] IE 9            \r\n        [] IE 10           \r\n\r\n    - Windows XP\r\n        [] IE 7            \r\n        [] IE 8            \r\n\r\n    - Mac OSX\r\n        [X] Google Chrome   \r\n        [] Firefox         \r\n        [X] Opera           \r\n        [X] Safari          \r\n\r\n    - iOS (iPhone)\r\n        [X] Safari Mobile   \r\n        [] Google Chrome   \r\n        [] Opera           \r\n\r\n    - iOS (iPad)\r\n        [] Safari Mobile   \r\n        [] Google Chrome   \r\n        [] Opera            \r\n\r\n    - Android\r\n        [] Firefox         \r\n        [X] Native Browser  \r\n        [] Google Chrome   \r\n        [] Opera\r\n```",
