   "body" : "# Spice Pull Request Template\r\n\r\nUsing this template will help us better understand your Instant Answer and assist you when necessary.  Simply copy and paste the markdown below into the description of your GitHub pull request and complete as appropriate.\r\n\r\n**What does your instant answer do?**\r\nDisplays the book title, author, publisher, year of publication, and a small picture of the book cover for a query ISBN.\r\n\r\n**What problem does your instant answer solve (Why is it better than organic links)?**\r\nSee book details without opening the Amazon page or Google Books page, for example.\r\n\r\n**What is the data source for your instant answer? (Provide a link if possible)**\r\nhttps://openlibrary.org/\r\n\r\n**Why did you choose this data source?**\r\nFree and open, unlimited API requests, reliable, large catalog.\r\n\r\n**Are there any other alternative (better) data sources?**\r\nGoogle Books and read.gov maybe, but these have daily limits on API requests.\r\n\r\n**What are some example queries that trigger this instant answer?**\r\n\"isbn 0451526538\", \"isbn number 0451526538\", \"0451526538 isbn\", \"0451526538 isbn number\"\r\n\r\n**Which communities will this instant answer be especially useful for? (gamers, book lovers, etc)**\r\nBook lovers!\r\n\r\n**Is this instant answer connected to a DuckDuckHack [instant answer idea](https://duck.co/ideas)?**\r\nYes, this â€“ https://duck.co/ideas/idea/301/isbn-barcode-lookup\r\n\r\n**Which existing instant answers will this one supersede/overlap with?**\r\nNone. Searches for \"isbn xxxxxxxxxxxxx\" and \"isbn number xxxxxxxxxxxxx\" did not return instant answers.\r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\nYes, please! Testing on mobile and placing css styles in another file rather than inline in the handlebar. Would also appreciate suggestions to improve on the instant answer appearance!\r\n\r\n**\\*\\*Note:** Please attach a screenshot for new instant answer pull requests, and for pull requests which modify the look/design of existing instant answers.\r\n![solong](https://cloud.githubusercontent.com/assets/6028224/3281332/da8e3054-f4a1-11e3-9a40-2530cf6bd28b.png)\r\n![fahreheit451](https://cloud.githubusercontent.com/assets/6028224/3281333/e178bc4a-f4a1-11e3-84f0-67ae1932de61.png)\r\n\r\n## Checklist\r\nPlease place an 'X' where appropriate.\r\n\r\n```\r\n[X] Added metadata and attribution information\r\n[X] Wrote test file and added to t/ directory\r\n[X] Verified that instant answer adheres to design guidelines(https://github.com/duckduckgo/duckduckgo-documentation/blob/master/duckduckhack/styleguides/design_styleguide.md)\r\n[X] Tested cross-browser compatability\r\n\r\n    Please let us know which browsers/devices you've tested on:\r\n    - Windows 8\r\n        [] Google Chrome   \r\n        [] Firefox         \r\n        [] Opera           \r\n        [] IE 10           \r\n\r\n    - Windows 7\r\n        [] Google Chrome   \r\n        [] Firefox         \r\n        [] Opera           \r\n        [] IE 8            \r\n        [] IE 9            \r\n        [] IE 10           \r\n\r\n    - Windows XP\r\n        [] IE 7            \r\n        [] IE 8            \r\n\r\n    - Mac OSX\r\n        [] Google Chrome   \r\n        [X] Firefox         \r\n        [] Opera           \r\n        [] Safari          \r\n\r\n    - iOS (iPhone)\r\n        [] Safari Mobile   \r\n        [] Google Chrome   \r\n        [] Opera           \r\n\r\n    - iOS (iPad)\r\n        [] Safari Mobile   \r\n        [] Google Chrome   \r\n        [] Opera            \r\n\r\n    - Android\r\n        [] Firefox         \r\n        [] Native Browser  \r\n        [] Google Chrome   \r\n        [] Opera\r\n\r\n     -  [X] Firefox â€“ Debian\r\n```\r\n",
