   "state" : "closed",
   "body" : "<b>What does your instant answer do?</b> Searches for similar sites.\r\n\r\n<b>What problem does your instant answer solve?</b> It helps user to find similar pages like he uses and also provides their rating\r\n\r\n<b>What is the data source for your instant answer?</b> It is https://developer.similarweb.com/\r\n\r\n<b>Why did you choose this data source?</b> It is the best one which also supports rating.\r\n\r\n<b>Are there any other alternative (better) data sources?</b> I think no.\r\n\r\n<b>What are some example queries that trigger this instant answer?</b> \"sites like facebook.com\" \"similar web to youtube.com\"\r\n\r\n<b>Which communities will this instant answer be especially useful for?</b> It would be for everyone who is looking for site alternatives. \r\n\r\n<b>Is this instant answer connected to a DuckDuckHack instant answer idea?</b> Yep, here it is https://duck.co/ideas/idea/1054/sites-like\r\n\r\n<b>Which existing instant answers will this one supersede/overlap with?</b> I think there is not plugin like this one.\r\n\r\n<b>Are you having any problems? Do you need our help with anything?</b> Yes, I want to add icon of pages into the item box. Is it possible?\r\n![similarsites](https://cloud.githubusercontent.com/assets/865063/3233205/bc244048-f0bb-11e3-9d89-130a8c5061d5.png)\r\n\r\nhttps://duck.co/ia/view/similar_sites",
