   "comments" : 3,
   "state" : "open",
   "body" : "The instant answer currently works if we specify an author, e.g., \"gandhi quotes\". But Brainy Quote should also handle topics such as \"physics quotes\". Problem with that is it can be too broad sometimes--it can trigger on things like \"apple quotes\" or \"stock quotes\".\r\n\r\nWe should explore the idea of using the top 120 topic quotes on http://www.brainyquote.com/quotes/topics.html and only accept those (it would be the JS code that will do the checking).\r\n\r\nhttps://duck.co/ia/view/brainy_quote",
