   "state" : "closed",
   "body" : "Saw this was requested a few times in the forum and wanted to try my hand at adding an instant answer to DDG!\r\n\r\n**What does your instant answer do?**\r\nLooks up basic stock/security quote info from Yahoo finance and provides that data in an instant answer\r\n\r\n**What problem does your instant answer solve (Why is it better than organic links)?**\r\nProviding up-to-date stock quotes\r\n\r\n**What is the data source for your instant answer? (Provide a link if possible)**\r\nhttp://developer.yahoo.com/yql/console/\r\n\r\nIt would be wise of us to apply for API keys if this Spice is going to go live, but I wanted to get feedback first (just using the open API for now)\r\n\r\n**Why did you choose this data source?**\r\nYahoo Finance is the go-to source of security price info used in the finance industry (aside from Bloomberg). In a web browser, finance professionals always seem to choose Yahoo Finance. Also, Yahoo Console is free/easily accessible.\r\n\r\n**Are there any other alternative (better) data sources?**\r\nIn the forum, Kevin_WSL found a number of alternatives.\r\n\r\nhttp://blog.programmableweb.com/2013/05/22/96-stocks-apis-bloomberg-nasdaq-and-etrade/\r\n\r\n**What are some example queries that trigger this instant answer?**\r\n*finance yhoo\r\n*stock ibm\r\n*stock price goog\r\n*share aapl\r\n*share price shy\r\n*px rrr\r\n*stock quote cat\r\n\r\nA little awkward because quote trigger is already taken.\r\n\r\n**Which communities will this instant answer be especially useful for? (gamers, book lovers, etc)**\r\nfinance professionals, investors, everyone\r\n\r\n**Is this instant answer connected to a DuckDuckHack [instant answer idea](https://duck.co/ideas)?**\r\n\r\n*https://duck.co/ideas/idea/299/real-time-stock-quotes\r\n*https://duck.co/ideas/idea/31/displaying-the-current-stocket-exchange-rate-of-a\r\n*https://duck.co/ideas/idea/838/real-time-stock-quotes-and-market-info\r\n\r\n**Which existing instant answers will this one supersede/overlap with?**\r\nWolfram Alpha's auto stock quote info.\r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\nHaven't yet worked out the front end. Would love suggestions and feedback. Right now it is just a listing of some high level data returned from the API.\r\n\r\n![stockquotecat](https://f.cloud.github.com/assets/3512705/1894849/c0bcde42-7b01-11e3-84e1-4dd37ccc9976.png)\r\n![stockquotemsft](https://f.cloud.github.com/assets/3512705/1894853/f36e413c-7b01-11e3-85f0-dcb5ce1f6b49.png)\r\n\r\n\r\n##Checklist\r\nPlease place a âœ” where appropriate.\r\n\r\n```\r\n[âœ”] Added metadata and attribution information\r\n[] Wrote test file and added to t/ directory\r\n[] Verified that instant answer adheres to design guidelines(https://github.com/duckduckgo/duckduckgo-documentation/blob/master/duckduckhack/styleguides/design_styleguide.md)\r\n[] Tested cross-browsear compatability\r\n\r\n    Please let us know which browsers/devices you've tested on:\r\n    - Windows 8\r\n        [] Google Chrome   \r\n        [] Firefox         \r\n        [] Opera           \r\n        [] IE 10           \r\n\r\n    - Windows 7\r\n        [] Google Chrome   \r\n        [] Firefox         \r\n        [] Opera           \r\n        [] IE 8            \r\n        [] IE 9            \r\n        [] IE 10           \r\n\r\n    - Windows XP\r\n        [] IE 7            \r\n        [] IE 8            \r\n\r\n    - Mac OSX\r\n        [] Google Chrome   \r\n        [] Firefox         \r\n        [] Opera           \r\n        [] Safari          \r\n\r\n    - iOS (iPhone)\r\n        [] Safari Mobile   \r\n        [] Google Chrome   \r\n        [] Opera           \r\n\r\n    - iOS (iPad)\r\n        [] Safari Mobile   \r\n        [] Google Chrome   \r\n        [] Opera            \r\n\r\n    - Android\r\n        [] Firefox         \r\n        [] Native Browser  \r\n        [] Google Chrome   \r\n        [] Opera\r\n```",
