   "state" : "closed",
   "body" : "**Plugin functionality** :\r\nProvides release date information for movies and games.\r\n\r\n**Plugin data sources (APIs)** :\r\n[TheMovieDB](http://www.themoviedb.org)\r\n\r\n[GiantBomb](http://www.giantbomb.com)\r\n\r\n**Reason for API selection** :\r\nTheMovieDB because it provides a stable API - could also be provided by IMDb but they lack enthusiasm for open-source projects.\r\n\r\nGiantBomb because it supports community-driven content so it boasts a wide database.\r\n\r\n**Example queries** :\r\n* release date thor\r\n* thor 2 release\r\n* when did the simpsons game come out\r\n\r\n**Plugin Audience** :\r\nMovie watchers\r\n\r\nGamers\r\n\r\n**Have you done any cross-browser testing?**\r\nYes, it works completely cross-browser.\r\n\r\n**Is this plugin connected to an [Ideas.DuckDuckHack](https://duckduckhack.uservoice.com/forums/5168-ideas-for-duckduckgo-instant-answer-plugins) or [Duck.co](http://duck.co/) thread?**\r\nYes, it provides the movie and game part of [this idea](https://duckduckhack.uservoice.com/forums/5168-ideas-for-duckduckgo-instant-answer-plugins/suggestions/3610037-show-release-date-for-games-movies-and-tv-shows).\r\n\r\n**Which existing plugins will this plugin supercede/overlap with?**\r\nIt provides a specific service, but it hold similarities with the IMDb plugin and the Rotten tomatoes plugin.\r\n\r\n![](https://f.cloud.github.com/assets/2399307/1366293/f220743e-38c7-11e3-9203-fb4db8d2a434.png)\r\n",
