   "state" : "closed",
   "body" : "Hello! Here is my another plugin.\r\n\r\n***Plugin functionality:*** this plugin searches for tv series and displays 4 recent episodes. It also searches for similar ones and displays it in hidden div. Founder of guidebox is working on movie implementation, so we will be able to search for movies, too.\r\n\r\n***Plugin data source (API):*** http://api-public.guidebox.com (you need to register your own api-key. I'm using the temporary one)\r\n\r\n***Reason for API selection:*** No special reason. I saw [this tweet](https://twitter.com/duckduckhack/status/328872054281601026)\r\n\r\n***Example queries :*** `full episodes of NCIS` `free episodes of Castle` `watch NCIS`\r\n\r\n***Plugin Audience :*** Videos are only available in the USA for watching. Guidebox founder would like it to be triggered only in the USA.\r\n\r\n***Have you done any cross-browser testing?*** Firefox and Chromium\r\n\r\n![screenshot](https://f.cloud.github.com/assets/865063/478687/1d6e982a-b801-11e2-812b-cb1f3b348896.png)",
