   "body" : "The Go Packages Fathead fetches the list of official packages that you can import from http://golang.org/pkg/. It currently handles disambiguations (typing in \"template\" should give both \"html/template\" and \"text/template\"), and it can also understand the shortened package names (typing in \"url\" should redirect to the \"net/url\" package).\r\n\r\nThere is definitely room for improvement such as fetching the different functions and types and constants within those packages, but that is probably another project on its own. ",
