   "state" : "closed",
   "body" : "**What does your Instant Answer do?**\r\nDisplay module, theme, and distrbution information from drupal.org when searching by machine name :eyeglasses: \r\n\r\n**What problem does your Instant Answer solve (Why is it better than organic links)?**\r\nSimilar to ```npm```, provides basic information about module, theme, and distributions without having to click the first result. :boom: \r\n\r\n**What is the data source for your Instant Answer? (Provide a link if possible)**\r\nhttps://www.drupal.org/api-d7/node.json?field_project_machine_name=panels (replace panels with query) \r\n\r\n**Why did you choose this data source?**\r\nIt's the official website for all things Drupal, period. :bell: \r\n\r\n**Are there any other alternative (better) data sources?**\r\nUnless if you're talking about private data sources, nope. :no_entry: \r\n\r\n**What are some example queries that trigger this Instant Answer?**\r\nThe format is drupal (project machine name) or (project machine name) drupal.\r\ndrupal token, panelizer drupal, drupal zen, drupal bear, wordpress_import drupal. :see_no_evil:\r\n\r\n**Which communities will this Instant Answer be especially useful for? (gamers, book lovers, etc)**\r\nDrupal developers :computer:, site builders :art:, and administrators :crown:. \r\n(I'm :eyes: at you, @zivtech, @rockriverstar, @gocultivate, @acquia, etc!)\r\n\r\n**Is this Instant Answer connected to a DuckDuckHack Instant Answer idea?**\r\nNope.\r\n\r\n**Which existing Instant Answers will this one supersede/overlap with?**\r\nDrupal Answers. :droplet: Drupal.org should supersede Drupal Answers when a result is available because the person is likely searching for a specific module/theme/distrbution rather than asking a question. :sweat_drops: \r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\nNot... yet. First time creating an instant answers as a DDG fanboy and it's much easier than what I've expected! :smile:\r\nI plan on making some more this month - and i might come to the DuckDuckHack meetup in Philly! :dart: \r\n\r\n**What are the terms of use for the API? Will DuckDuckGo need specific authorization (e.g. an API key)? Are there any costs associated with API usage?**\r\nNothing, it's free & open to the public.\r\n\r\n**What does the Instant Answer look like? (Provide a screenshot for new or updated Instant Answers)**\r\n![image](https://cloud.githubusercontent.com/assets/607807/8449867/23711ade-1fa3-11e5-800e-3443a3d827dd.png)\r\n![image](https://cloud.githubusercontent.com/assets/607807/8449870/2dc88274-1fa3-11e5-9b4f-d708cccfcf30.png)\r\n![image](https://cloud.githubusercontent.com/assets/607807/8449883/3f19684a-1fa3-11e5-8e09-ec8291744d9f.png)\r\n![image](https://cloud.githubusercontent.com/assets/607807/8449887/4b48b7ce-1fa3-11e5-91da-bd9d971b13ba.png)\r\n\r\n**Checklist**\r\n- [X] Added metadata and attribution information\r\n- [x] Wrote test file and added to t/ directory\r\n- [X] Verified that instant answer adheres to design guidelines (https://duck.co/duckduckhack/design_styleguide)\r\n- [x] Verified that instant answer adheres to code styleguide (https://duck.co/duckduckhack/code_styleguide)\r\n- [X] Tested cross-browser compatibility\r\n\r\n**Please let us know which browsers/devices you've tested on:**\r\nMacbook Safari 7.1.7, Chrome 45.0.2438.3-dev; iPad iOS 8.4 Safari; Windows 10 IE11, Edge;\r\n\r\n-----\r\nIA Page: https://duck.co/ia/view/drupal_search",
