   "state" : "closed",
   "body" : "So you know, I've mainly copied the Gimp_Cheat_Sheet files and just changed the information where relevant. \r\n\r\n**What does your Instant Answer do?**\r\nShows a cheat sheet of shortcuts for Blender\r\n\r\n**What problem does your Instant Answer solve (Why is it better than organic links)?**\r\nOrganic links point to pdf pages for most of them.\r\n\r\n**What is the data source for your Instant Answer? (Provide a link if possible)**\r\nhttp://overapi.com/blender/\r\n\r\n**Why did you choose this data source?**\r\nSeemed to be the most coherent and well organized one.\r\n\r\n**Are there any other alternative (better) data sources?**\r\nyes.\r\n\r\n**What are some example queries that trigger this Instant Answer?**\r\nblender help\r\nblender shortcuts\r\nblender keybindings\r\n\r\n**Which communities will this Instant Answer be especially useful for? (gamers, book lovers, etc)**\r\nThe huge community of Blender users (1/2 million download a month)\r\n\r\n**Is this Instant Answer connected to a DuckDuckHack [Instant Answer idea](https://duck.co/ideas)?**\r\nNo\r\n\r\n**Which existing Instant Answers will this one supercede/overlap with?**\r\nNone\r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\nNo\r\n\r\n**Where did you hear about DuckDuckHack? (For first time contributors)**\r\nTwitter\r\n\r\n**What does the Instant Answer look like? (Provide a screenshot for new or updated Instant Answers)**\r\n![ddg-blender-shorcut](https://cloud.githubusercontent.com/assets/192539/6994306/e82a0b3e-dae2-11e4-9caa-685d0ffb5103.png)\r\n\r\n\r\n## Checklist\r\nPlease place an 'X' where appropriate.\r\n\r\n- [x] Added metadata and attribution information (https://duck.co/duckduckhack/metadata)\r\n- [x] Wrote test file and added to t/ directory (https://duck.co/duckduckhack/goodie_tests)\r\n- [x] Verified that instant answer adheres to design guidelines (https://duck.co/duckduckhack/design_styleguide)\r\n- [x] Verified that instant answer adheres to code styleguide (https://duck.co/duckduckhack/code_styleguide)\r\n- [x] Tested cross-browser compatibility\r\n\r\n    Please let us know which browsers/devices you've tested on:\r\n    - Windows 8\r\n        - [] Google Chrome\r\n        - [] Firefox\r\n        - [] Opera\r\n        - [] IE 10\r\n\r\n    - Windows 7\r\n        - [] Google Chrome\r\n        - [] Firefox\r\n        - [] Opera\r\n        - [] IE 8\r\n        - [] IE 9\r\n        - [] IE 10\r\n\r\n    - Windows XP\r\n        - [] IE 7\r\n        - [] IE 8\r\n\r\n    - Mac OSX\r\n        - [] Google Chrome\r\n        - [] Firefox\r\n        - [] Opera\r\n        - [] Safari\r\n\r\n    - iOS (iPhone)\r\n        - [] Safari Mobile\r\n        - [] Google Chrome\r\n        - [] Opera\r\n\r\n    - iOS (iPad)\r\n        - [] Safari Mobile\r\n        - [] Google Chrome\r\n        - [] Opera\r\n\r\n    - Android\r\n        - [] Firefox\r\n        - [] Native Browser\r\n        - [] Google Chrome\r\n        - [] Opera\r\n\r\n    - Gnu/Linux\r\n        - [x] Google Chrome\r\n        - [x] Firefox\r\n        - [x] Opera\r\n\r\n-------\r\n\r\nIA Page: https://duck.co/ia/view/blender_cheat_sheet",
