   "state" : "closed",
   "body" : "\r\n**What does your Instant Answer do?**\r\n\r\nProvides an overview of craft beer brewers in the State of Vermont, target audience being craft beer fans and those researching craft beer tourist destinations.\r\n\r\n**What problem does your Instant Answer solve (Why is it better than organic links)?**\r\n\r\nAggregates salient information about all the brewers in the state: site, social media, location, branding & logos, and presents it for an individual brewer.  More information is available if the community feels it's appropriate.\r\n\r\n**What is the data source for your Instant Answer? (Provide a link if possible)**\r\n\r\n**[The Data](http://vtbeertrail.com/data/vtbrewers.json)**\r\n\r\n**Why did you choose this data source?**\r\n\r\nI authored both this one true data file as well as the site upon which it depends, **[VT Beer Trail](http://www.vtbeertrail.com)**.\r\n\r\n**Are there any other alternative (better) data sources?**\r\n\r\nThere are certainly deeper beer related resources available, but none that are focused solely on Vermont's craft brewers.\r\n\r\n**What are some example queries that trigger this Instant Answer?**\r\n\r\n\"vermont breweries\", \"vermont beer\", \"vermont beer trail\", \"beer trail in vermont\"\r\n\r\n**Which communities will this Instant Answer be especially useful for? (gamers, book lovers, etc)**\r\n\r\nCraft beer fans, beer tourists.\r\n\r\n**Is this Instant Answer connected to a DuckDuckHack [Instant Answer idea](https://duck.co/ideas)?**\r\n\r\nNot that I am aware.\r\n\r\n**Which existing Instant Answers will this one supersede/overlap with?**\r\n\r\nN/A\r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\n\r\nYes.\r\n\r\nThe map image you will see in the detail pane of my proposed IA, I find to be the cheesy side of cheesy, but here's why it exists, currently as a placeholder.\r\n\r\nAllow me to go backwards one step first.  If I query [crop bistro and brewery location](https://duckduckgo.com/?q=crop+bistro+and+brewery+location), your Places IA properly kicks in and the presentation is fantastic!  Clearly you guys are bringing in two(2) data sources for that presentation: OpenStreetMap (OSM) and Yelp.\r\n\r\nThe phrase \"two data sources\" is where I hit my limits.\r\n\r\nIdeally to me this proposed IA would incorporate a \"real\" map in the detail pane, and that is where I would need help, if this is something that can even be exposed to outside contributors!\r\n\r\nHere's another thing though, **[The Data File](http://vtbeertrail.com/data/vtbrewers.json)** already has the lat/lon co-ordinates for each brewer's location one needs to send to OSM, so the interim step of asking MapQuest to geo-code a Place seems redundant.\r\n\r\nN.B. I have also presented a question within the CSS code comments.\r\n\r\n**What are the terms of use for the API? Will DuckDuckGo need specific authorization (e.g. an API key)? Are there any costs associated with API usage?**\r\n\r\nFree to use, my contribution.  If there is a specific open source license DDG prefers to work with, I will incorporate that language, however one does that.\r\n\r\n**Where did you hear about DuckDuckHack? (For first time contributors)**\r\n\r\nI forget :( .  But when I discovered you were located in Paoli, I was sold.\r\n\r\n**What does the Instant Answer look like? (Provide a screenshot for new or updated Instant Answers)**\r\n\r\n![image](https://cloud.githubusercontent.com/assets/873785/5136935/7a48b820-70fe-11e4-85c4-0becb3a1d92f.png)\r\n\r\n## Checklist\r\nPlease place an 'X' where appropriate.\r\n\r\n[x] Added metadata and attribution information\r\n\r\n[x] Wrote test file and added to t/ directory\r\n\r\n[x] Verified that instant answer adheres to design guidelines (https://duck.co/duckduckhack/design_styleguide)\r\n\r\n[x] Verified that instant answer adheres to code styleguide (https://duck.co/duckduckhack/code_styleguide)\r\n\r\n[] Tested cross-browser compatibility\r\n\r\n    Please let us know which browsers/devices you've tested on:\r\n    - Windows 8\r\n        [] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] IE 10\r\n\r\n    - Windows 7\r\n        [] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] IE 8\r\n        [] IE 9\r\n        [] IE 10\r\n\r\n    - Windows XP\r\n        [] IE 7\r\n        [] IE 8\r\n\r\n    - Mac OSX\r\n        [] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] Safari\r\n\r\n    - iOS (iPhone)\r\n        [] Safari Mobile\r\n        [] Google Chrome\r\n        [] Opera\r\n\r\n    - iOS (iPad)\r\n        [] Safari Mobile\r\n        [] Google Chrome\r\n        [] Opera\r\n\r\n    - Android\r\n        [] Firefox\r\n        [] Native Browser\r\n        [] Google Chrome\r\n        [] Opera\r\n```\r\n\r\nI don't have a device lab :(, just my Ubuntu 12.04 work station, running Chrome and it's amazing Dev-Tools emulator.\r\n\r\nI went with the on-line service DDG recommends, www.codio.com, because I was not comfortable messing with/upgrading the Perl version running locally.\r\n",
