   "body" : "Math::Prime::Util::GMP is said to be a lot faster in computing factors than the pure Perl implementation in Math::Prime::Util. See how feasible this is, and if installing GMP on people's systems is difficult (since people with DuckPAN will be using it on Linux and OS X), move it to another repository like https://github.com/duckduckgo/zeroclickinfo-goodie-qrcode.\r\n\r\nMake sure to add install instructions there, too.\r\n\r\n**Update:**\r\nWe're now accepting external libraries (such as https://github.com/duckduckgo/zeroclickinfo-goodies/blob/master/lib/DDG/Goodie/ChineseZodiac.pm#L5 which depends on https://duckduckgo.com/?q=mpfr). So using a XS version of Math::Prime::Util is totally fine.\r\n\r\nhttps://duck.co/ia/view/prime_factors",
