   "state" : "closed",
   "body" : "This is an internal Goodie (here it is in action: https://duckduckgo.com/?q=urldecode+test%2520there and https://duckduckgo.com/?q=rot13+hello), and it's better for it to live in the open source side. It needs: \r\n- Metadata\r\n- Comments\r\n- Formatting\r\n- Tests\r\n- A replacement for `DDG::Util::String`\r\n- A list of prereqs in `dist.ini`. \r\n\r\nIf anybody is interested in doing that, here's the code:\r\n\r\n```perl\r\npackage DDG::Goodie::Simple;\r\nuse DDG::Goodie;\r\nuse Crypt::Rot13;\r\nuse Digest::MD5;\r\nuse DDG::Util::String qw(encode_for_link escape_for_display);\r\nuse Encode qw(encode);\r\nzci type => 'E';\r\nzci answer_type => 'digest';\r\n\r\ntriggers start => 'url', 'html', 'encode', 'decode', 'rot13', 'escape', 'md5', 'urlencode', 'urldecode', 'urlescape', 'htmlescape', 'htmlencode', 'htmldecode';\r\n\r\nhandle query => sub {\r\n    # md5\r\n    # Can't use lc because will do wrong digest.\r\n    if ( $_ =~ /^md5(?:sum|) (hex|base64|)\\s*(.*)$/i ) {\r\n\tmy $command = $1 || '';\r\n\tmy $str     = $2 || '';\r\n\r\n\tif ($str) {\r\n\t    if ( $command && $command eq 'base64' ) {\r\n\t\t$str = Digest::MD5::md5_base64(encode(\"utf8\",$str));\r\n\t    }\r\n\t    else {\r\n\t\t$str = Digest::MD5::md5_hex(encode(\"utf8\",$str));\r\n\t    }\r\n\t    return qq($str);\r\n\t}\r\n\treturn;\r\n    }\r\n    # rot13\r\n    elsif ( $_ =~ /^rot13 (.*)$/i ) {\r\n\tmy $str = $1 || '';\r\n\tif ($str) {\r\n\t    my $rot13 = Crypt::Rot13->new;\r\n\t    $rot13->charge($str);\r\n\t    ($str) = $rot13->rot13();\r\n\t    return qq($str);\r\n\t}\r\n\treturn;\r\n    }\r\n\r\n    # urlencode/decode\r\n    if ( $_ =~ /^(?:url|html|encode|decode|escape) ?(url|html|encode|decode|escape)\\s*(.*)$/i ) {\r\n\tmy $command = $1 || '';\r\n\tmy $str     = $2 || '';\r\n\tif ($str) {\r\n\r\n\t    if ( $command && $command eq 'decode' ) {\r\n\t\t$str = URI::Escape::uri_unescape($str);\r\n\t\t$str = escape_for_display($str);\r\n\t\t$str =~ s/\\r\\n/<br>/;\r\n\t\tif ( $str =~ /^\\s+$/ ) {\r\n\t\t    $str =~ s/\\r/CReturn/;\r\n\t\t    $str =~ s/\\n/Newline/;\r\n\t\t    $str =~ s/\\t/Tab/;\r\n\t\t    $str =~ s/\\s/Space/;\r\n\t\t}\r\n\t    }\r\n\t    else {\r\n\t\t$str = encode_for_link($str);\r\n\t    }\r\n\t    my $cxt = (($_ =~ /encode/i || $_ =~ /escape/i) ? 'en' : 'de') . 'coded url';\r\n\t   \r\n\t    return qq($str \\($cxt\\));\r\n\t}\r\n\treturn;\r\n    }\r\n    return;\r\n};\r\n1;\r\n```",
