   "body" : "**What does your Instant Answer do?**\r\nMy Instant Answer adds a cheat sheet for the programming language Lua. It shows the basic operators and how to create functions, tables, variables and comments.\r\n\r\n**What is the data source for your Instant Answer? (Provide a link if possible)**\r\n[Lua cheat sheet for programmers](http://coffeeghost.net/2010/11/01/lua-cheat-sheet-for-programmers/)\r\n\r\n**Why did you choose this data source?**\r\nI chose it because it is a good source for getting a quick overview over how Lua works.\r\n\r\n**Are there any other alternative (better) data sources?**\r\nA good but very more detailed alternative would be [this](http://thomaslauer.com/download/luarefv51.pdf).\r\n\r\n**Which communities will this Instant Answer be especially useful for? (gamers, book lovers, etc)**\r\nThis Instant Answer will be especially useful for programmers and normal people who want to get into programming with Lua.\r\n\r\n**Is this Instant Answer connected to a DuckDuckHack [Instant Answer idea](https://duck.co/ideas)?**\r\nYes, it is connected to the idea [6171](https://duck.co/ia/view/6171).\r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\nNo, I didn't have problems with it. Thanks.\r\n\r\n**Where did you hear about DuckDuckHack? (For first time contributors)**\r\nI was interested in Instant Answers and looked up if it is possible to create them myself.\r\n\r\n**What does the Instant Answer look like? (Provide a screenshot for new or updated Instant Answers)**\r\n![Screenshot](http://sc.korn-online.org/090915191149.png)\r\n\r\n-----\r\nIA Page: https://duck.co/ia/view/lua_cheat_sheet",
