   "labels_url" : "https://api.github.com/repos/duckduckgo/zeroclickinfo-spice/issues/1812/labels{/name}",
   "comments" : 4,
   "pull_request" : {
      "patch_url" : "https://github.com/duckduckgo/zeroclickinfo-spice/pull/1812.patch",
      "html_url" : "https://github.com/duckduckgo/zeroclickinfo-spice/pull/1812",
      "url" : "https://api.github.com/repos/duckduckgo/zeroclickinfo-spice/pulls/1812",
      "diff_url" : "https://github.com/duckduckgo/zeroclickinfo-spice/pull/1812.diff"
   },
   "state" : "closed",
   "body" : "We're switching to deep triggers because it's difficult to extract the location from a query. We can understand location for some queries such as \"javascript jobs in philadelphia\" because of the \"in\" preposition, but we can do nothing for queries such as \"javascript nyc jobs\" because we don't have the functionality to get the location part of the query. For the mean time, we switch to a Deep trigger so that we can pass the right location to the Indeed API endpoint.\r\n\r\n**What is a Deep trigger?**\r\n\r\nA Deep trigger is triggering based on the SERP results instead of on the query. This means we can look in the search results, see indeed.com domains (such as indeed.com/q-Javascript-l-San-Francisco,-CA-jobs.html), extract the things that we want using regexp (in this case, \"Javascript\" and \"San Francisco, CA\"), and pass that along to the endpoint. Unfortunately, it isn't open source at the moment so it's a bit of a black box at the moment.\r\n\r\n![screen shot 2015-04-27 at 9 29 30 pm](https://cloud.githubusercontent.com/assets/81969/7361340/8b743474-ed24-11e4-9db8-d8871d1ad849.png)\r\n\r\nCurrently depends on an internal PR. Will ping if it's ready.",
