   "state" : "closed",
   "body" : "**What does your Instant Answer do?**\r\n\r\nLists the next 5 upcoming rocket launches, with a link to where to watch them online if available.\r\n\r\n**What problem does your Instant Answer solve (Why is it better than organic links)?**\r\n\r\nWeb sources tend to list only a subset of launches. \"upcoming rocket launches\" autocompletes, but the results are poor.\r\n\r\n**What is the data source for your Instant Answer? (Provide a link if possible)**\r\n\r\nThe data comes from [http://launchlibrary.net](LaunchLibrary.net).\r\n\r\n**Why did you choose this data source?**\r\n\r\nIt provides a free, open API that is kept up to date by space enthusiasts. It's used as an authoritative source by weekly podcasts.\r\n\r\n**Are there any other alternative (better) data sources?**\r\n\r\nThe listing at [http://spaceflightnow.com/launch-schedule/](SpaceflightNow) is more likely to be up-to-date (because they have a staff tracking changes), but I don't know of an API for it.\r\n\r\n**What are some example queries that trigger this Instant Answer?**\r\n\r\n\"upcoming space launches\", \"next space launch\". Once the first version is up, I plan to ask the community for better triggers.\r\n\r\n**Which communities will this Instant Answer be especially useful for? (gamers, book lovers, etc)**\r\n\r\nSpace enthusiasts. \r\n\r\n**Is this Instant Answer connected to a DuckDuckHack [Instant Answer idea](https://duck.co/ideas)?**\r\n\r\nYes, it implements the [Upcoming rocket launches](https://duck.co/ideas/idea/6244/upcoming-rocket-launches-and-how-to-watch-them) idea.\r\n\r\n**Which existing Instant Answers will this one supersede/overlap with?**\r\n\r\nNone.\r\n\r\n**Are you having any problems? Do you need our help with anything?**\r\n\r\nNo, going well so far.\r\n\r\n**What are the terms of use for the API? Will DuckDuckGo need specific authorization (e.g. an API key)? Are there any costs associated with API usage?**\r\n\r\nNo costs or API  key needed. The API is designed to be a public resource.\r\n\r\n**Where did you hear about DuckDuckHack? (For first time contributors)**\r\n\r\nI heard about DuckDuckHack from Zac Pappis in the USV Slack.\r\n\r\n**What does the Instant Answer look like? (Provide a screenshot for new or updated Instant Answers)**\r\n\r\n<img width=\"1355\" alt=\"screen shot 2015-08-29 at 10 30 24 pm\" src=\"https://cloud.githubusercontent.com/assets/275080/9565845/b77da0a2-4e9d-11e5-97f5-063f11604179.png\">\r\n\r\n## Checklist\r\nPlease place an 'X' where appropriate.\r\n\r\n```\r\n[X] Added metadata and attribution information\r\n[X] Wrote test file and added to t/ directory\r\n[X] Verified that instant answer adheres to design guidelines (https://duck.co/duckduckhack/design_styleguide)\r\n[X] Verified that instant answer adheres to code styleguide (https://duck.co/duckduckhack/code_styleguide)\r\n[] Tested cross-browser compatibility\r\n\r\n    Please let us know which browsers/devices you've tested on:\r\n    - Windows 8\r\n        [] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] IE 10\r\n\r\n    - Windows 7\r\n        [] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] IE 8\r\n        [] IE 9\r\n        [] IE 10\r\n\r\n    - Windows XP\r\n        [] IE 8\r\n\r\n    - Mac OSX\r\n        [X] Google Chrome\r\n        [] Firefox\r\n        [] Opera\r\n        [] Safari\r\n\r\n    - iOS (iPhone)\r\n        [] Safari Mobile\r\n        [] Google Chrome\r\n        [] Opera\r\n\r\n    - iOS (iPad)\r\n        [] Safari Mobile\r\n        [] Google Chrome\r\n        [] Opera\r\n\r\n    - Android\r\n        [] Firefox\r\n        [] Native Browser\r\n        [] Google Chrome\r\n        [] Opera\r\n```\r\n\r\nIA Page: https://duck.co/ia/view/launch_library",
