   "state" : "closed",
   "body" : "https://youtu.be/6BdRYSbaAG0\r\n\r\nLooks like the problem is that there are two keyframes named `loader-animate` and they're both doing different things.\r\n\r\n<img width=\"2025\" alt=\"screen_shot_2015-12-02_at_10_27_20_pm\" src=\"https://cloud.githubusercontent.com/assets/81969/11551134/813e68b8-9944-11e5-9f41-7ba325feab39.png\">\r\n\r\nI suggest renaming the keyframe in Riffsy to something else. This doesn't affect anything else except for Riffsy so this is a localized problem not to worry.\r\n\r\n\\+ @bsstoner @moollaza ",
