   "state" : "closed",
   "body" : "This plugin gets its data from http://gruntjs.com/plugin-list.json which I admit is a bit big at around 200kb. I think this is ok though since the triggering is limited to \"grunt plugins\" and \"gruntjs plugins\". I think anyone searching with those kind of queries have a high signal that they are actually looking for grunt plugins so I think it's worth loading those 200kb (some IAs even load more data--look at recipes. It makes the page 2MB big with the query \"cake\")\r\n\r\nHope this is ok!\r\n\r\nIt's modeled after the rubygems spice:\r\n\r\n<img width=\"985\" alt=\"screen shot 2016-01-15 at 3 59 39 am\" src=\"https://cloud.githubusercontent.com/assets/81969/12349289/77a84f3e-bb3c-11e5-89f0-d17295ef71d7.png\">\r\n\r\n---\r\n\r\nhttps://duck.co/ia/view/grunt",
