   "body" : "Unfortunately in getting `Regexp` to display nicely on full-width screens, it seems the mobile display has been reduced:\r\n\r\n![screenshot from 2016-02-27 12 16 30](https://cloud.githubusercontent.com/assets/8598426/13372810/f73af9aa-dd4b-11e5-915e-ead68ec32414.png)\r\n\r\nVS\r\n\r\n![screenshot from 2016-02-27 12 16 37](https://cloud.githubusercontent.com/assets/8598426/13372812/fd4138b4-dd4b-11e5-9bf8-e0a3be9c327e.png)\r\n\r\nWhat needs to be done:\r\n\r\n* Fix the mobile display so that both the pattern names ***and*** matches consistently display well.\r\n* Ensure the full-screen display is robust and won't be messed up by long queries. \r\n\r\n---\r\nIA Page: https://duck.co/ia/view/regexp",
